 function displayProductsFactory(url, categoryCode) {
   $.get(url, function (data, status) {
     if (!data || data.length === 0) return;

     // ✅ vider la catégorie avant de recharger
     const categoryDiv = document.getElementById(categoryCode);
     if (!categoryDiv) return;
     categoryDiv.innerHTML = "";

     const products = data; // si c'est data.items adapte ici
     data.forEach(p => {
       const card = `
         <div class="col-md-3 mb-4">
           <div class="card h-100 shadow-sm">
             <img src="$value(BASE_URL)/contents/code/${p.picture}/file" class="card-img-top"  alt="${p.title}">

             <div class="card-body">
               <h5 class="card-title">${p.title}</h5>
               <p class="card-text">${p.description}</p>
               <p class="fw-bold text-success">${p.price}</p>
               <button class="btn btn-success w-100">Add to Cart</button>
             </div>
           </div>
         </div>
       `;
       categoryDiv.innerHTML += card;
     });
   });
 }

