function displaySales() {

      const salesContainer = document.getElementById("sales-container");
      const salesDiv = document.getElementById("sales");

      // show section
      salesContainer.style.display = "block";
      salesDiv.innerHTML = "";

 		$.get("$value(BASE_URL)/contents/node/code/CAMPAIGN_SUMMER_2025-2465023474?payloadOnly=true&status=SNAPSHOT", function (data, status) {


          const now = new Date();

          const activePromos = data.filter(p => {
            const start = new Date(p.startDate);
            const end = new Date(p.endDate);
            return now >= start && now <= end;
          });

          if (activePromos.length === 0) {
            return; // nothing to display
          }

            activePromos.forEach(p => {
              const discountedPrice = (p.price - (p.price * p.discount / 100)).toFixed(2);

              const promo = `
                <div class="col-md-6">
                  <div class="promo-card d-flex p-3 shadow-sm h-100">
                    <div class="me-3">
                      <img src="$value(BASE_URL)/contents/code/${p.picture}/file" class="img-fluid rounded"  alt="${p.title}" style="max-width:200px">

                    </div>
                    <div class="flex-grow-1 d-flex flex-column justify-content-between">
                      <div>
                        <h4 class="mb-2">${p.title}</h4>
                        <p class="mb-2">${p.description}</p>
                        <p>
                          <span class="promo-old-price">$${p.price.toFixed(2)}</span>
                          <span class="fw-bold text-success">$${discountedPrice}</span>
                        </p>
                        <p class="promo-discount">-${p.discount}% OFF</p>
                      </div>
                      <div>
                        <small class="text-muted">Valid from ${p.startDate} to ${p.endDate}</small>
                        <button class="btn btn-success btn-sm w-100 mt-2">Add to Cart</button>
                      </div>
                    </div>
                  </div>
                </div>
              `;
              salesDiv.innerHTML += promo;
            })

        });

 }


 window.addEventListener('load', function () {
    function waitForjQuery(callback) {
      if (window.jQuery) {
        callback();
