.promo-card {
  border: 2px dashed #28a745;
  border-radius: 1rem;
  overflow: hidden;
  background: #f9fff9;
  transition: transform 0.2s ease;
}
.promo-card:hover {
  transform: scale(1.02);
}
.promo-discount {
  font-size: 1.2rem;
  font-weight: bold;
  color: #dc3545;
}
.promo-old-price {
  text-decoration: line-through;
  color: #6c757d;
  margin-right: 8px;
}

